// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 < 0.9.0;

contract Ex2_10 {

    struct Human {
        string name;
        uint age;
        string job;
    }

    Human public human1 = Human("ploy", 25, "artist");
    Human public human2;

    function getHuman1() public view returns(Human memory){
        return human1;
    }


}

